import React from "react";
import { Box, Input, OutlinedInput, TextField } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import logo from "/run/media/ij-singh/My Data/WEB DEVELOPMENT/Full Stack Projects/social-media-app/client/src/img/logo.png";

const LogoSearch = () => {
  return (
    <Box
      display={"flex"}
      sx={{
        position: "relative",
      }}
      alignItems={"center"}

    >
      <img src={logo} alt="logo" />
      <OutlinedInput
        inputProps={{
          style: {
            padding: "10px",
            outline: "none",
            border: "0",
            width: "100%",
            height: "100%",
            borderRadius: "30px"

          },
        }}
        border={"0px"}
        margin="2"
        placeholder={'#Explore'}

      />
      <Box
        sx={{
          position: "absolute",
          right: "0",
          background: "#fca61f",
          color: "#f3f3f3",
          padding: "5px",
          borderRadius: '5px'

        }}
        // padding={2}
        color={"primary.main"}
      >
        <SearchIcon
          fontSize="small"
        />
      </Box>
    </Box>
  );
};

export default LogoSearch;
